import React from "react";
import { Input } from "antd";
const onSearch = (value) => console.log(value);
const { Search } = Input;
function Filter(title, rate) {
  return (
    <div>
      <Search
        placeholder="input search text"
        enterButton="Search"
        onSearch={onSearch}
      />
      <Search
        style={{ margin: "1rem", width: "75rem" }}
        placeholder="input search text"
        allowClear
        onSearch={onSearch}
        size="large"
      />
    </div>
  );
}

export default Filter;
